define version=631
@update_header

DECLARE
	v_parent_id		NUMBER;
	v_id			NUMBER;
BEGIN
	SELECT factor_type_id
	  INTO v_parent_id
	  FROM csr.factor_type
	 WHERE name = 'Electricity Consumed';
	
	SELECT factor_type_id_seq.nextval
	  INTO v_id
	  FROM dual;
	
		VALUES (v_id, v_parent_id, 'REC', 9, 1);
	

END;
/

@update_tail
